 = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1051536","type":"CustomJS"},{"attributes":{"below":[{"id":"1051362"}],"center":[{"id":"1051365"},{"id":"1051369"}],"height":90,"left":[{"id":"1051366"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"1051391"}],"sizing_mode":"stretch_width","title":{"id":"1051597"},"toolbar":{"id":"1051378"},"toolbar_location":null,"width":null,"x_range":{"id":"1051116"},"x_scale":{"id":"1051358"},"y_range":{"id":"1051356"},"y_scale":{"id":"1051360"}},"id":"1051354","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1051159","type":"DataRange1d"},{"attributes":{"label":{"value":"Trades (1230)"},"renderers":[{"id":"1051427"}]},"id":"1051444","type":"LegendItem"},{"attributes":{},"id":"1051166","type":"BasicTicker"},{"attributes":{"bottom":{"field":"Close"},"fill_color":{"field":"inc","transform":{"id":"1051404"}},"line_color":{"value":null},"top":{"field
